import React, { useEffect, useState } from "react";
import companylogo from "../image/company-logo.png";
function Home() {
  const [one, setone] = useState(false);
  const [one2, setone2] = useState(false);
  useEffect(() => {
    line();
    line2();
  }, []);

  const line = () => {
    setTimeout(() => {
      setone(!one);
    }, 3000);
  };

  const line2 = () => {
    setTimeout(() => {
      setone2(!one2);
    }, 6000);
  };

  return (
    <>
      <nav>
        <div className="nav-view">
          <div className="container">
            <div className="row">
              <div className="col-md-6">
                <div className="logo">
                  <img src={companylogo} className="img-fluid" />
                </div>
              </div>
              <div className="col-md-6">
                <div className="nav-list">
                  <ul className="nav-types">
                    <li className="active">Home</li>
                    <li>About</li>
                    <li>Product</li>
                    <li>Carrer</li>
                    <li>Contact Us</li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </nav>

      <section className="company-add">
        <div className="add-image">
          <div className="container-fluid">
            <div className="add"></div>
          </div>
          <div className="quotes">
            <div className="container">
              <div
                className={one2 === true ? "company-quotes2" : "company-quotes"}
              >
                <div className={one === true ? "quotes2" : "quotes1"}>
                  <h3 className="line">
                    <span>An</span> in house website and mobile
                  </h3>
                  <h3 className="line">
                    application and develping company ...
                  </h3>
                </div>

                <div className={one === true ? "nxtquotes" : "nxtquotes2"}>
                  <h3 className="line">
                    {" "}
                    <span>WE</span> are building our own brands
                  </h3>
                  <h3 className="line">registared and recognasize india ...</h3>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <section className="footer">
        <div className="container">
          <div className="row">
            <div className="col-md-4">
              <div className="about">
                <div className="about-name">
                  <h3>ABOUT</h3>
                </div>
              </div>
            </div>
            <div className="col-md-4"></div>
            <div className="col-md-4"></div>
          </div>
        </div>
      </section>
    </>
  );
}

export default Home;
